import axios from 'axios';


export const deploy = async (collectionName, collectionTokenSymbol, contractBaseURI, contractSupply, contractPrice) => {

  console.log("here");
  console.log(collectionName, collectionTokenSymbol, contractBaseURI, contractSupply, contractPrice);

  // const url = 'http://localhost:4000/';

  const data = {
    "contractName": collectionName,
    "contractTokenSymbol": collectionTokenSymbol,
    "contractBaseURI": contractBaseURI,
    "contractSupply": contractSupply,
    "contractPrice": contractPrice
  }

  axios.post('http://localhost:4000/deploy_contract', data, {
    headers: {"Access-Control-Allow-Origin": "*"}})
  .then(function (response) {
    console.log(response);
  })
  .catch(function (error) {
    console.log(error);
  });

};
